import React from "react";

export default function Task(props) {
  return (
    <li className="task">
      {props.important ? (
        <i class="fa-solid fa-star" onClick="handleToggle"></i>
      ) : (
        <i class="fa-regular fa-star"></i>
      )}
      {props.title}
    </li>
  );
}
